import React from 'react';
import Log from './componentsel/Log';
import Logcr from './componentsel/Logcr';
import './Login.css';

export default class Login extends React.Component {
  state = {
    email: 'v.chaxalyan@mail.ru',
    password: 'sdfgergre',
  };

  render() {
    const { login } = this.state;
    return (
      <div className='login'>
        <Log Ren={this.Ren} />
        <Logcr email={this.state.email} password={this.state.password} />;
      </div>
    );
  }
}
